define({"topics" : [{"title":"Meet <span class=\"ph\">StreamSets Control Hub</span>","shortdesc":"\n            <p class=\"shortdesc\"><span class=\"ph\">StreamSets Control Hub</span><sup class=\"ph sup\">TM</sup> is a central point of control for all of your dataflow pipelines. <span class=\"ph\">Control Hub</span> allows         teams to build and execute large numbers of complex dataflows at scale. \n            </p>\n         ","id":"concept_l45_qwf_xw","href":"datacollector\/UserGuide\/DPM\/DPM.html#concept_l45_qwf_xw","menu": {"hasChildren":true,},"tocID":"concept_l45_qwf_xw-d46e95221","next":"concept_l45_qwf_xw-d46e95221",},{"title":"Working with <span class=\"ph\">Control Hub</span>","shortdesc":"\n            <p class=\"shortdesc\"></p>\n         ","id":"concept_evb_3bs_bx","href":"datacollector\/UserGuide\/DPM\/WorkingWithDPM.html#concept_evb_3bs_bx","menu": {"hasChildren":false,},"tocID":"concept_evb_3bs_bx-d46e95642","topics":[]},{"title":"Request a <span class=\"ph\">Control Hub</span> Organization and User Account\n         ","shortdesc":"\n            <p class=\"shortdesc\"></p>\n         ","id":"concept_lry_34g_xw","href":"datacollector\/UserGuide\/DPM\/OrgUserAccount.html#concept_lry_34g_xw","menu": {"hasChildren":false,},"tocID":"concept_lry_34g_xw-d46e95668","topics":[]},{"title":"Register Data Collector with <span class=\"ph\">Control Hub</span>","shortdesc":"\n            <p class=\"shortdesc\">You must register a <span class=\"ph\">Data Collector</span> to         work with <span class=\"ph\">StreamSets Control Hub</span>.         When you register a <span class=\"ph\">Data Collector</span>, <span class=\"ph\">Data Collector</span>         generates an authentication token that it uses to issue authenticated requests to <span class=\"ph\">Control Hub</span>.\n            </p>\n         ","id":"concept_kc4_xyf_xw","href":"datacollector\/UserGuide\/DPM\/RegisterSDCwithDPM.html#concept_kc4_xyf_xw","menu": {"hasChildren":true,},"tocID":"concept_kc4_xyf_xw-d46e95695","next":"concept_kc4_xyf_xw-d46e95695",},{"title":"Pipeline Statistics","shortdesc":"\n            <p class=\"shortdesc\">A <span class=\"ph\">Control Hub</span>         job defines the pipeline to run and the <span class=\"ph\">Data Collector</span>s that         run the pipeline. When you start a job, <span class=\"ph\">Control Hub</span>         remotely runs the pipeline on the group of <span class=\"ph\">Data Collector</span>s. To         monitor the job statistics and metrics within <span class=\"ph\">Control Hub</span>, you         must configure the pipeline to write statistics to <span class=\"ph\">Control Hub</span> or to         another system.\n            </p>\n         ","id":"concept_h2q_mb5_xw","href":"datacollector\/UserGuide\/DPM\/AggregatedStatistics.html#concept_h2q_mb5_xw","menu": {"hasChildren":true,},"tocID":"concept_h2q_mb5_xw-d46e96366","next":"concept_h2q_mb5_xw-d46e96366",},{"title":"Pipeline Management with <span class=\"ph\">Control Hub</span>","shortdesc":"\n            <p class=\"shortdesc\">After you register a <span class=\"ph\">Data Collector</span> with             <span class=\"ph\">StreamSets Control Hub</span>,         you can manage how the pipelines work with <span class=\"ph\">Control Hub</span>.\n            </p>\n         ","id":"concept_eq5_qjd_fx","href":"datacollector\/UserGuide\/DPM\/PipelineManagement.html#concept_eq5_qjd_fx","menu": {"hasChildren":true,},"tocID":"concept_eq5_qjd_fx-d46e97854","next":"concept_eq5_qjd_fx-d46e97854",},{"title":"<span class=\"ph\">Control Hub</span> Configuration File\n         ","shortdesc":"\n            <p class=\"shortdesc\"></p>\n         ","id":"concept_hrn_zz3_fx","href":"datacollector\/UserGuide\/DPM\/DPMConfiguration.html#concept_hrn_zz3_fx","menu": {"hasChildren":false,},"tocID":"concept_hrn_zz3_fx-d46e98359","topics":[]},{"title":"Unregister Data Collector from <span class=\"ph\">Control Hub</span>","shortdesc":"\n            <p class=\"shortdesc\">You can unregister a <span class=\"ph\">Data Collector</span> from             <span class=\"ph\">StreamSets Control Hub</span>         when you no longer want to use that <span class=\"ph\">Data Collector</span>         installation with <span class=\"ph\">Control Hub</span>. \n            </p>\n         ","id":"concept_ldb_sr5_cx","href":"datacollector\/UserGuide\/DPM\/UnregisterSDCwithDPM.html#concept_ldb_sr5_cx","menu": {"hasChildren":true,},"tocID":"concept_ldb_sr5_cx-d46e98385","next":"concept_ldb_sr5_cx-d46e98385",}]});